description:
Operation: Blockade is a 2002 first person shooter video game developed by Screaming Games and published by Infogrames for the PC and arcade systems. Set in a mock World War II environment, the game has online capabilities, and was released to mediocre reviews and criticism.

During WWII, the Saruvian Empire invades and conquers the entire mainland of the United Sovereign Territories and only the southernmost island of Johnstown is free. The UST is able to build a small fort on a deserted island between the two nations though and use it to harass enemy supply lines. The UST is a fictional nation standing in for the United States, using all US weapons and medals. The Saruvian Empire is a fictional nation standing in for Germany, using all WWII era German weapons, uniforms, names, and political terms.

Similar to Beach Head.

Install &amp; play.

Tested on Windows 7 / 8 32 bit.

